import Card from "../Card/Card"
import "./CardsGrid.css"
import personajes from "../../data/personajes"

const CardsGrid = () => {
    const personajes = [
        {
            id: 1,
            name: "Anakin",
            img: "ankin.jpg",
            descricion: "",
            mas: ""
        },
        {
            id: 2,
            name: "Ahsoka",
            img: "ahsoka.jpg",
            descricion: "",
            mas: ""
        },
        {
            id: 3,
            name: "Batman",
            img: "batman.jpg",
            descricion: "",
            mas: ""
        }
    ]
    return(
        <section>
            <div className="card-container">
            {personajes.map((personajes, idx)=>
                <Card key={idx}
                name={personajes.name} descripcion={personajes.descripcion} img={personajes.img} id={personajes.id} mas={personajes.mas}/>
            )}
            </div>
        </section>

    )        
}
export default CardsGrid
